import React from "react";
import { ReactComponent as Weather_icons_cloudy } from "../SVG/weather_icons_cloudy.svg";

const ActualPos = () => {
  const location = "San Marcos";
  const date = "5PM 07/07/22";

  return (
    <div className="bg-white rounded-lg w-1/2 m-auto h-4/5 mt-8">
      <p> {location}</p>
      <p> {date} </p>
      <Weather_icons_cloudy />
    </div>
  );
};

export default ActualPos;
